import React, { Component } from 'react';

class Counter extends Component {
	state = { 
		wallet_id: 1234
	};

	render() {
		return (
			<div>
			<span>{"Good Morning, your wallet number: " + this.formatCount()}</span>
			<button>Increment</button>
			</div>
		);
	}

	formatCount() {
		const { wallet_id } = this.state;
		const x =  <h1>Yes</h1>;
		return wallet_id === 1234 ? x :<h1>wallet_id</h1>;
	}
}

export default Counter;
